create table monsters_spawns_dungeons_copy1
(
    Id                int auto_increment
        primary key,
    MapId             int               null,
    CellId            int               null,
    TeleportEvent     tinyint default 1 null,
    TeleportMapId     int               null,
    TeleportCell      smallint          null,
    TeleportDirection int               null,
    Descripcion       varchar(255)      null
)
    engine = MyISAM
    charset = utf8;

